import React, { Fragment } from 'react';
import EquipementGare from './EquipementGare'

class Gare extends React.Component {
    render() {
        this.props.data.map((element) => {
            console.log(element.data().nom);

        })
        this.setState({
            nom: element.data()
        });

        return (
            <Fragment>

                <EquipementGare data={this.props.data} />
            </Fragment>
        )

    }
}
export default Gare
